import axiosInstance from "../axios/axios.js";

const booksRepository = {
    findAll: async () => {
        return await axiosInstance.get("/books");
    },
    findById: async (id) => {
        return await axiosInstance.get(`/books/${id}`);
    },
};

export default booksRepository;
